import React from 'react';
import '../css/Filter.css';
const Filter = () => {
	return (
		<div className='Filter--comp'>
			<div className="filter">
				<ul className='filters'>
					<li>all todos</li>
					<li>waitings</li>
					<li>inprogresses</li>
					<li>completed</li>
				</ul>
			</div>
		</div>
	);
};

export default Filter;
